import React, { useEffect, useState } from "react";

import axios from 'axios';

import "./DisplayInventory.css";
const URL = "http://Localhost:5000/items"

const fetchHandler = async ()=>{
    return await axios.get(URL).then((res)=>res.data);
}

function DisplayInventory(props) {

    const [items,setItems] = useState();

    useEffect (()=>{
        fetchHandler().then((data)=>setItems(data.items));
    }
,[])
const [_id,itemname,getprice,sellprice,pices,date] = props.item;
  return (
    <div>
      <div className="inventroy">
        <div className="table">
            <table >
                <tr><th>No </th>
                    <th>Item Name </th>
                    <th>Get Price</th>
                    <th>Sell Price </th>
                    <th>Pices </th>
                    <th>Date </th>
                </tr>
                {items.map((val, key) => {
                    
                        <tr key={key}>
                            <td>{val._id}</td>
                            <td>{val.itemname}</td>
                            <td>{val.getprice}</td>
                            <td>{val.sellprice}</td>
                            <td>{val.pices}</td>
                            <td>{val.date}</td>
                        </tr>
                    
                })}
                
            </table>
        </div>
      </div>
    </div>
  );
}

export default DisplayInventory;
